import React, {Component} from 'react';
import dynamic from 'next/dynamic'

import Html from "../src/Html";
import Head from "../src/Head";

export default class Post extends Component{
  render(){
    return(
      <head>
      <meta charset="utf-8"></meta>
      <meta http-equiv="x-ua-compatible" content="ie=edge"></meta>
      {/** Changer le Accueil en fonction de la page o√π l'on se trouve */}
      <title>Accueil - Centre Sportif de Perwez</title>
      <meta name="description" content="This is the home page of Centre Sportif de Perwez and the index default page"></meta>
      <meta property="og:title" content="Centre Sportif de Perwez"></meta>
      <meta property="og:type" content="website"></meta>
      <meta property="og:url" content="https://centresportifdeperwez.be/"></meta>
      {/* Mettre le logo en image <meta property="og:image" content="test.png"></meta> */}
  </head>
    )
  }
}
